        [TestMethod]
        [Description("Comparing two different images ( different sizes )")]
        public void Validate_Different_Files()
        {
            using (var kernel = new NSubstituteMockingKernel())
            {
                var _manageImagesAppService = kernel.Get<ManageImagesAppService>();
                int currentId = 1;
                string _leftImage = @"";
                string _rightImage = @"";

                ValidationResultViewModel leftFile = _manageImagesAppService.AddImage(currentId, new IncomeImageViewModel() { Base64Image = _leftImage }, Constants.ImageSide.Left);
                Assert.AreEqual((int)Constants.PossibleReturns.SUCCESSFULLY_SAVED, leftFile.Result);

                ValidationResultViewModel rightFile = _manageImagesAppService.AddImage(currentId, new IncomeImageViewModel() { Base64Image = _rightImage }, Constants.ImageSide.Right);
                Assert.AreEqual((int)Constants.PossibleReturns.SUCCESSFULLY_SAVED, rightFile.Result);

                ValidationResultViewModel modelResult = _manageImagesAppService.CompareImages(currentId);
                Assert.AreEqual((int)Constants.PossibleReturns.DIFFERENT_FILES, modelResult.Result);

            }
        }

